import React from 'react';

const Cafe = () => {
return (
	<div>
	    <table>
	        <tr>
	            
				<tr>Moriarty Cafe</tr>
	            <td><img src="/Images/FoodCola.jpg" /></td>
	            <td><img src="/Images/FoodPopcorn.jpg" /></td>
	        </tr>
	        <tr>
	            <td>Choose your Cola</td>
	            <td></td>
	        	
				<td>Choose your Popcorn</td>
	        </tr>
	    </table>
	</div>
);
};

export default Cafe;
